import React from "react";
import styles from "../styles/Main.module.scss";

function Edit() {
    return (
        <>
           <div className={styles.MainDiv}>
                <form action="/edit" method="POST">

                    <input type="text" name="ProductId" placeholder="ProductId" />
                </form>
           </div>
        </>
    );
}

export default Edit;
